import React from "react";
import TeamMember from './TeamMember';

function Team(){
    return(
        <div className="row">
            <TeamMember
                info = {{
                    name: "Jon Snow",
                    img: "./img/Jon_snow.jpg",
                    position: "King of the Andals and the First Men, Lord of the Seven Kingdoms, and Protector of the Realm",
                    phone: "0541412724",
                    email: 'King@gmail.com',
                    website: "ironThrone.com"

                }}
            />
            <TeamMember
                info = {{
                    name: "Cersei Lannister",
                    img: "./img/cersei.jpg",
                    position: "Queen of the Andals and the First Men",
                    phone: "0541412724",
                    email: 'Queen@gmail.com',
                    website: "ironThrone.com"

                }}
            />
            <TeamMember
                info = {{
                    name: "Daenerys Targaryen",
                    img: "./img/daenerys.jpg",
                    position: "Princess of Dragonstone The Unburnt Queen of Meereen Queen of the Andals, the Rhoynar and the First Men (claimant) Protector of the Seven Kingdoms (claimant) Khaleesi of the Great Grass Sea Breaker of Shackles Mother of Dragons Television: The One Who Was Promised Lady of Dragonstone",
                    phone: "0541412724",
                    email: 'Queen@gmail.com',
                    website: "ironThrone.com"

                }}
            />

        </div>

    ) 
}
export default Team;
